Ken Burns: On the Record

Biography Documentary hosted by Dick Pryor, published by PBS in 2012 - English narration


Information
------------------------------

Award-winning filmmaker Ken Burns sits down with OETA's Dick Pryor to discuss his three decades of making documentaries along with his latest film, &quot;The Dust Bowl,' upcoming projects, and the thrill of filming America's history.

